import React from "react";
import { useNavigate } from "react-router-dom";
import { useEffect, useState } from "react";
import axios from "axios";

// import Navbar from "../Components/navbar/Navbar.js";
import Totaldata from "../Components/totaldata/totaldata";
import Centreelement from "../Components/centerelement/centreelement.js";
import Projectdetails from "../Components/projectdetails/projectdetails.js";

// import projectcompletedlogo from "../Assests/images/projectcompletedlogo.svg";
import runningprojectlogo from ".././Assests/images/RunningProjects.svg";
// import pipelineprojectlogo from "../Assests/images/pipelineprojectlogo.svg";
// import supportrequiredlogo from "../Assests/images/supportrequiredlogo.svg";

// import Newbuglogo from "../Assests/images/newbuglogo.svg";
// import Dependencies from "../Assests/images/dependencieslogo.svg";
// import Codereview from "../Assests/images/CodeReview.svg";
// import Unittesting from "../Assests/images/UnitTesting.svg";
// import supportrequiredlogo from "../Assests/images/SupportRequired.svg";
// import pipelinelogo from "../Assests/images/Pipeline.svg";

// import Cipla from "../Assests/logos/cipla-logo.png";
// import BurgerKing from "../Assests/logos/burgerking-logo.png";
// import Adrenalin from "../Assests/logos/adrenalin-logo.png";
// import Bosch from "../Assests/logos/bosch-logo.webp";
// import Glance from "../Assests/logos/glance-logo.png";
// import Genmat from "../Assests/logos/genmat-logo.jpeg";
// import Talocity from "../Assests/logos/talocity-logo.png";
// import Relias from "../Assests/logos/relias-logo.png";

import "../Pages/homepage.scss";

function Homepage() {
  const navigate = useNavigate();
  const tilesData = [
    {
      title: "Total Project",
      cardIcon: runningprojectlogo,
      count: 10,
    },
  ]
  const [ProjectData, setProjectData] = useState([]);
  useEffect(() => {
    axios
      .get("http://13.233.18.99:3010/api/v1/projects/getOverallproject")
      .then((response) => {
        setProjectData(response.data);
        console.log("api value", response.data);
      })
      .catch((error) => console.log(error));
  }, []);

  // [
  //   {
  //     logoUrl: Cipla,
  //     projectName: "Cipla",
  //     status: "Inprogress",
  //     // project_condition2: "H-Risk",
  //     startDate: "12 Aug",
  //     stopDate: "12 Jun",
  //     completionPercentage: "92",
  //     delay: "delayed by 5 days",
  //     completionComments: "5days to go",
  //     dependency_logo: Dependencies,
  //     dependency_percent: "85%",
  //     bug_logo: Newbuglogo,
  //     bugData: "1000",
  //     codereview_logo: Codereview,
  //     codereviewData: "21%",
  //     unit_test_logo: Unittesting,
  //     unitTestData: "0%",
  //   }
  // ];
  return (
    <div className="home-main-container__home-container">
      <div className="home-main-container__main-container">
        <div className="home-main-container__tiles-container">
          {tilesData &&
            tilesData.length > 0 &&
            tilesData.map((item, index) => <Totaldata key={index} {...item} />)}
          {/* {ProjectData.content &&
            ProjectData.content.length > 0 &&
            ProjectData.content.map((item, index) => (
              <Totaldata key={index} {...item} />
            ))} */}
        </div>
        <Centreelement />
        <div
          className="home-main-container__project_idividual_table"
        >
          {console.log("original value", ProjectData?.content?.projects)}
          {ProjectData?.content?.projects &&
            ProjectData?.content?.projects?.length > 0 &&
            ProjectData?.content?.projects?.map((datas, index) => (
              <Projectdetails key={index} {...datas} />
            ))}
        </div>
      </div>
    </div>
  );
}

export default Homepage;
